import React from 'react';
import './header.css';

const Header = () => {
  return (
    <header className="header">
      <h1>Taskify</h1>
      <div className="user-info">
        <span>tcm123</span>
        <span>tc123@gmail.com</span>
        <button>Log Out</button>
      </div>
    </header>
  );
};

export default Header;
